import React from "react";

const CardsFamourfor = ({ movie }) => {
  return (
    <div className="minicards">
      <img
        src={"https://image.tmdb.org/t/p/original" + movie.poster_path}
        alt=""
      />
      <p>{movie.title}</p>
    </div>
  );
};

export default CardsFamourfor;
